func minimumCost(source string, target string, original []string, changed []string, cost []int) int64 {
    inf := int64(1e9 + 7)
    n := len(source)
    dp := make([][]int64, n+1)
    for i := range dp {
        dp[i] = make([]int64, n+1)
        for j := range dp[i] {
            dp[i][j] = inf
        }
    }
    dp[0][0] = 0

    for i := 0; i <= n; i++ {
        for j := 0; j <= i; j++ {
            if dp[i][j] == inf {
                continue
            }
            if i < n && j < n && source[i] == target[j] {
                dp[i+1][j+1] = min(dp[i+1][j+1], dp[i][j])
            }
            for k := 0; k < len(original); k++ {
                if i+len(original[k]) <= n && j+len(changed[k]) <= n {
                    if source[i:i+len(original[k])] == original[k] && target[j:j+len(changed[k])] == changed[k] {
                        dp[i+len(original[k])][j+len(changed[k])] = min(dp[i+len(original[k])][j+len(changed[k])], dp[i][j]+int64(cost[k]))
                    }
                }
            }
        }
    }

    ans := inf
    for i := 0; i <= n; i++ {
        ans = min(ans, dp[n][i])
    }

    if ans == inf {
        return -1
    }
    return ans
}

func min(a, b int64) int64 {
    if a < b {
        return a
    }
    return b
}
